import Foundation
import UIKit

public let UIActivityTypePostToWeChatSession: String = "com.opensocial.activity.PostToWeChatSession"
public let UIActivityTypePostToWeChatTimeline: String = "com.opensocial.activity.PostToWeChatTimeline"

public class GDOpenSocialWeChatSessionActivity: GDOpenSocialActivity {
    public override func activityType() -> String? {
        return UIActivityTypePostToWeChatSession
    }
    
    public override func activityTitle() -> String? {
        return NSBundle.mainBundle().preferredLocalizations.first == "zh-Hans" ? "微信好友" : "WeChat Session"
    }
    
    public override func activityImageBase64EncodedString() -> String? {
        return ""
    }
    
    public override func canPerformWithActivityItems(activityItems: [AnyObject]) -> Bool {
        return super.canPerformWithActivityItems(activityItems) && GDOpenSocial.isWeChatApiAvailable
    }
    
    public override func performActivity() {
        GDOpenSocial.shareToWeChatSession(message) { (data, error) -> Void in
            if error == nil {
                self.activityDidFinish(true)
            } else {
                self.activityDidFinish(false)
            }
        }
    }
}

